Not Forgotten (2009) 

Verenigde Staten
Thriller

geregisseerd door Dror Soref
met Paz Vega, Simon Baker en Michael DeLorenzo

Bankmanager Jack Bishop en zijn Latijns-Amerikaanse vrouw Amaya wonen in een plaatsje in het Texaans-Amerikaanse grensgebied. Hun leven wordt overschaduwd door de ontvoering en dood van hun dochtertje. Amaya roept de hulp in van een expert in Latijns-Amerikaanse mystica om te achterhalen wat er precies gebeurd is met hun dochtertje. Maar de constante visioenen van deze vrouw dreigen een geheim verleden van de Bishops bloot te leggen.


